INSERT INTO msggateway.msg_template VALUES (318, '23', 'General Purpose OTP Tamil', 'அன்புள்ள {#var#}, {#var#}க்கான ஓ.டி.பி(OTP) {#var#}, தயவுசெய்து யாருடனும் பகிர வேண்டாம். இது அடுத்த 5 நிமிடங்களுக்கு செல்லுபடியாகும் - இந்திய அஞ்சல்', 'INPOST', '1001081725895192800', '1007642866484301653', '1', 1, '2024-09-23 15:59:44.802806', 'UC');
INSERT INTO msggateway.msg_template VALUES (316, '23', 'General Purpose OTP Telugu', 'ప్రియ {#var#}, {#var#} కొరకు మీ ఓ.టి.పి(OTP) {#var#}. దీనిని ఎవరితోనూ షేర్ చేయకండి.  ఇది తదుపరి 5 నిమిషాల వరకు చెల్లుబాటు అవుతుంది – ఇండియా పోస్ట్', 'INPOST', '1001081725895192800', '0007532572186927885', '1', 1, '2024-09-23 15:59:44.802806', 'UC');
INSERT INTO msggateway.msg_template VALUES (317, '23', 'General Purpose OTP Kannada', 'ಆತ್ಮೀಯ {#var#}, {#var#} ಗಾಗಿ ಒ.ಟಿ.ಪಿ(OTP) {#var#} ಆಗಿದೆ, ದಯವಿಟ್ಟು ಅದನ್ನು ಯಾರೊಂದಿಗೂ ಹಂಚಿಕೊಳ್ಳಬೇಡಿ. ಇದು ಮುಂದಿನ 5 ನಿಮಿಷಗಳವರೆಗೆ ಮಾನ್ಯವಾಗಿರುತ್ತದೆ  - ಭಾರತ ಪೋಸ್ಟ್', 'INPOST', '1001081725895192800', '0007532572186927886', '1', 1, '2024-09-23 15:59:44.802806', 'UC');
INSERT INTO msggateway.msg_template VALUES (319, '23', 'General Purpose OTP Odia', 'ପ୍ରିୟ {#var#}, {#var#} ପାଇଁ ଓ.ଟି.ପି (OTP) {#var#}, ଦୟାକରି ଏହାକୁ କାହା ସହିତ ଅଂଶୀଦାର କରନ୍ତୁ ନାହିଁ। ଏହା ପରବର୍ତ୍ତୀ ୫ ମିନିଟ୍ ପାଇଁ ବୈଧ ଅଟେ । - ଇଣ୍ଡିଆ ପୋଷ୍ଟ', 'INPOST', '1001081725895192800', '0007532572186927888', '1', 1, '2024-09-23 15:59:44.802806', 'UC');
INSERT INTO msggateway.msg_template VALUES (320, '23', 'General Purpose OTP Urdu', 'محترم {#var#}، {#var#} کے لیے OTP {#var#} ہے۔ براہ کرم اسے کسی کے ساتھ شیئر نہ کریں۔ یہ اگلے 5 منٹ کے لیے درست ہے - انڈیا پوسٹ', 'INPOST', '1001081725895192800', '0007532572186927889', '1', 1, '2024-09-23 15:59:44.802806', 'UC');
